import React, { Component } from "react";
import "./App.css";
import Pages from "./pages";
import "./villa.css";
import "./slide.css";
import logo from "./logo.png";

class App extends Component {
  render() {
    return (
      <div className="wrapper" style={{ display: "block" }}>
        <div className="siteLogo" style={{ padding: "40px 0  0 40px" }}>
          <a href="https://apologia.jp/index.html">
            <img src={logo} width={300} />
          </a>
        </div>
        <div
          className="sideBar"
          style={{ padding: "10px 10px 10px 10px", height: "auto" }}
        >
          <ul>
            <li className="shop">
              <a
                href="https://apologia.jp/philosophy/index.html"
                className="nav_shop"
              >
                The Villa
              </a>
            </li>
            <li className="shop">
              <a href="https://apologia.jp/collection/" className="nav_shop">
                Collection
              </a>
            </li>
            <li className="stockist">
              <a href="https://apologia.jp/about/index.html">About us</a>
            </li>
          </ul>
        </div>
      </div>
      // <Pages></Pages>
    );
  }
}

export default App;
